import React from 'react';
import { Container, Items } from './styles';
import Health from '../../../assets/health.svg';
import Payment from '../../../assets/payment.svg';
import Security from '../../../assets/security.svg';

const FourthSection: React.FC = () => {
  return (
    <Container>
      <h3>Recursos de fáceis de usar</h3>
      <p>
        Encontre seus serviços em saúde com facilidade e segurança na hora de
        pagar
      </p>
      <Items>
        <div className="item">
          <Health />
          <p>Teleconsulta</p>
        </div>
        <div className="item">
          <Payment />
          <p>Pague como quiser</p>
        </div>
        <div className="item">
          <Security />
          <p>
            Compre com <br /> segurança
          </p>
        </div>
      </Items>
    </Container>
  );
};

export default FourthSection;
